import React from 'react'

const Idea = ({datos}) => {
  return (
  <div >
    <div key={datos._id}>
    <h1>{datos.idea}</h1>
    <h2>Descripcion: {datos.description}</h2>
    <p>Autor: {datos.author.name}</p>
    </div>
  
  </div>
 
    )
}

export default Idea
